import VueRouter from 'vue-router'
import SortPage from '../views/Sort.vue'
LOCALHOST = 'localhost:8080'
export default new VueRouter({
    routes:[
        {
            path:LOCALHOST+'/store/product/column?id=55001&title=热销爆品',
            name:'sort',
            component:SortPage
        }
    ]
})
